.united-button,
.ua-button {
  font-family: 'OpenSans', sans-serif !important;
  font-size: 12px;
  font-weight: 600;
  display: block;
  height: 30px;
  box-sizing: border-box !important;
  line-height: 30px;
  padding: 0 23px;
  text-align: center !important;
  cursor: pointer !important;
  letter-spacing: .05em !important;
  color: #333;
  background-color: #EDB72B;
  max-width: 230px;
}
.united-button_caa,
.ua-button_caa {
  height: 36px;
  line-height: 36px;
  font-size: 14.4px;
  padding: 0 30px;
}
.united-button_inverse {
  color: #2774AE;
  background-color: #fff;
  border: 2px solid #2774AE;
}
.united-button_wide {
  height: 35px;
  line-height: 35px;
}
.ua-icon {
  display: flex;
  flex-shrink: 0;
  height: 25px;
  width: 25px;
  z-index: 1;
  background-size: 100%;
  background-repeat: no-repeat;
  background-position: center;
}
.ua-icon svg {
  width: 100%;
  height: 100%;
}
.united-serp__content {
  display: inline-block !important;
  height: 40px !important;
  box-sizing: border-box !important;
  padding: 5px 0 !important;
}

.aa-cta {
  display: inline-flex;
  flex-shrink: 0;
  justify-content: center;
  align-items: center;
  box-sizing: border-box;
  padding: 10px 15px;
  cursor: pointer;
  letter-spacing: 0.05em;
  line-height: 1.3;
  font-size: 12px;
  font-family: 'AmericanSansBold', sans-serif !important;
  border-radius: 3px;
  color: #fff;
  background: linear-gradient(180deg, #0078d2 0%, #0061ab 100%);
}
.aa-cta_big {
  font-size: 14px;
  padding: 10px 40px;
}
.aa-cta_login {
  padding: 10px 30px;
}
.aa-button {
  font-family: 'AmericanSans', sans-serif !important;
  font-size: 12px;
  font-weight: 600;
  display: block;
  height: 30px;
  border-radius: 3px;
  box-sizing: border-box !important;
  line-height: 30px;
  padding: 0 23px;
  text-align: center !important;
  cursor: pointer !important;
  letter-spacing: 0.05em !important;
  color: #fff;
  background: linear-gradient(180deg, #0078d2 0%, #0061ab 100%);
  max-width: 200px;
}
.aa-button_inverse {
  color: #fff;
  background: linear-gradient(180deg, #627a88 0%, #536773 100%);
}
.aa-button_wide {
  height: 35px;
  line-height: 35px;
}
